--
-- Table structure for table `manufacturing`
--

DROP TABLE IF EXISTS `manufacturing`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `manufacturing` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'индитифкатор строки',
  `parts_id` int unsigned DEFAULT NULL COMMENT 'ид каталожный номер детали',
  `equipment_id` int unsigned DEFAULT NULL COMMENT 'ид оборудование',
  `technological_operations_id` int unsigned DEFAULT NULL COMMENT 'ид технологическая операция',
  `manufacturing_time` int unsigned DEFAULT NULL COMMENT 'время изготовления детали в минутах',
  `staff_id` int unsigned DEFAULT NULL COMMENT 'ид ответственного сотрудника',
  `material_id` int unsigned DEFAULT NULL COMMENT 'ид используемого для изготовления материала',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'время обновления строки',
  PRIMARY KEY (`id`),
  KEY `manufacturing_fk_parts_id` (`parts_id`),
  KEY `manufacturing_fk_equipment_id` (`equipment_id`),
  KEY `manufacturing_fk_technological_operations_id` (`technological_operations_id`),
  KEY `manufacturing_fk_material_id` (`material_id`),
  KEY `manufacturing_fk_staff_id` (`staff_id`),
  CONSTRAINT `manufacturing_fk_equipment_id` FOREIGN KEY (`equipment_id`) REFERENCES `equipment` (`id`) ON DELETE SET NULL,
  CONSTRAINT `manufacturing_fk_material_id` FOREIGN KEY (`material_id`) REFERENCES `material` (`id`) ON DELETE SET NULL,
  CONSTRAINT `manufacturing_fk_parts_id` FOREIGN KEY (`parts_id`) REFERENCES `parts` (`id`) ON DELETE SET NULL,
  CONSTRAINT `manufacturing_fk_staff_id` FOREIGN KEY (`staff_id`) REFERENCES `staff` (`id`) ON DELETE SET NULL,
  CONSTRAINT `manufacturing_fk_technological_operations_id` FOREIGN KEY (`technological_operations_id`) REFERENCES `technological_operations` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

